import { Link } from 'react-router-dom';
import './menu.css';

export default function Menu() {
    return (
        <div className='menu'>
            <div className='container'>
            <div className='menu_container'>
                <div className='buttons'>
                    <Link to="/todo"><button className='todo'>Todo</button></Link>
                    <Link to="/timer"><button className='timer'>Timer</button></Link>
                </div>
            </div>
            </div>
        </div>
    );
}
